import React from 'react';
import './styles/Home.css';

function Home() {
  return (
    <div className="home">
      <h1>This is the home</h1>
      <div className="icon-container">
        <i className="fas fa-heart"></i>
        <i className="fas fa-star"></i>
      </div>
    </div>
  );
}

export default Home;
